import React from "react";
import CarouselPage from './react-bootstrap/CarouselPage';

export default function Dashboard() {

  return (
    <>
      <div className="row">
        <div className="col-xl-6">
          <CarouselPage text='hit TOP5'/>
        </div>

        <div className="col-xl-6">
          <CarouselPage text='scrap TOP5'/>
        </div>
      </div>
    </>
  );
}
